pragma solidity ^0.4.11;


import 'zeppelin-solidity/contracts/ownership/Ownable.sol';
import 'zeppelin-solidity/contracts/math/SafeMath.sol';
import './Monthly.sol';

/**
 * @title AntiMoneyLaundering
 * @dev Base contract which provides to children an anti money laundering capability.
 */
contract AntiMoneyLaundering is Ownable, Monthly {
  using SafeMath for uint256;

  uint256 defaultEmissionLimit = 50;
  uint256 defaultReceptionLimit = 50;
  uint256 defaultCumulatedEmissionLimit = 50;
  uint256 defaultCumulatedReceptionLimit = 50;

  // holder => limit
  mapping(address => uint256) emissionLimit;
  mapping(address => uint256) receptionLimit;

  // holder => cumulatedLimit
  mapping(address => uint256) cumulatedEmissionLimit;
  mapping(address => uint256) cumulatedReceptionLimit;

  // holder => date
  mapping(address => uint256) lastEmissionMonth;
  mapping(address => uint256) lastReceptionMonth;

  // holder => month => amount
  mapping(address => mapping(uint256 => uint256)) cumulatedEmissionAmount;
  mapping(address => mapping(uint256 => uint256)) cumulatedReceptionAmount;

  /**
   * @dev Modifier to make a function callable only when the emission is compliant with AML
   */
  modifier complyAMLonEmission(address _sender, uint256 amount) {
    require(transactionIsBelowEmissionLimit(_sender, amount));
    require(transactionIsBelowCumulatedEmissionLimit(_sender, amount));

    _;
  }

  /**
   * @dev Modifier to make a function callable only when the reception is compliant with AML
   */
  modifier complyAMLonReception(address _receiver, uint256 amount) {
    require(transactionIsBelowReceptionLimit(_receiver, amount));
    require(transactionIsBelowCumulatedReceptionLimit(_receiver, amount));
    _;
  }

  /**
   * @dev Function set the cumulatedEmissionLimit
   */
  function setHolderLimit(address _holder,
		uint256 _emissionLimit, uint256 _receptionLimit,
		uint256 _cumulatedEmissionLimit, uint256 _cumulatedReceptionLimit) onlyOwner public {
    emissionLimit[_holder]=_emissionLimit;
    receptionLimit[_holder]=_receptionLimit;
    cumulatedEmissionLimit[_holder] = _cumulatedEmissionLimit;
    cumulatedReceptionLimit[_holder] = _cumulatedReceptionLimit;
  }

  /**
   * @dev Function validating if the emission is below the emission limit
   */
  function transactionIsBelowEmissionLimit(address _sender, uint256 amount) view public returns (bool) {
    uint256 transactionLimit = emissionLimit[_sender];
    if(transactionLimit == 0) {
      transactionLimit = defaultEmissionLimit;
    }
    return (amount <= transactionLimit);
  }

  /**
   * @dev Function validating if the emission is below the cumulated yearly emission limit
   */
  function transactionIsBelowCumulatedEmissionLimit(address _sender, uint256 amount) public returns (bool) {
    uint256 month = getCurrentMonth();

    if(lastEmissionMonth[_sender] != month) {
      cumulatedEmissionAmount[_sender][month] = amount;
      lastEmissionMonth[_sender] = month;
    } else {   
      cumulatedEmissionAmount[_sender][month] =
         cumulatedEmissionAmount[_sender][month].add(amount);
    }

    if(cumulatedEmissionLimit[_sender] == 0) {
      return cumulatedEmissionAmount[_sender][month] <= defaultCumulatedEmissionLimit;
    }
    return cumulatedEmissionAmount[_sender][month] <= cumulatedEmissionLimit[_sender];
  }

  /**
   * @dev Function validating if the reception is below the reception limit
   */
  function transactionIsBelowReceptionLimit(address _receiver, uint256 amount) view public returns (bool) {
    uint256 transactionLimit = receptionLimit[_receiver];
    if(transactionLimit == 0) {
      transactionLimit = defaultReceptionLimit;
    }
    return (amount <= transactionLimit);
  }

  /**
   * @dev Function validating if the reception is below the cumulated yearly reception limit
   */
  function transactionIsBelowCumulatedReceptionLimit(address _receiver, uint256 amount) public returns (bool) {
    uint256 month = getCurrentMonth();

    if(lastReceptionMonth[_receiver] != month) {
      cumulatedReceptionAmount[_receiver][month] = amount;
      lastReceptionMonth[_receiver] = month;
    } else {
      cumulatedReceptionAmount[_receiver][month] =
         cumulatedReceptionAmount[_receiver][month].add(amount);
    }

    if(cumulatedReceptionLimit[_receiver] == 0) {
      return cumulatedReceptionAmount[_receiver][month] <= defaultCumulatedReceptionLimit;
    }
    return cumulatedReceptionAmount[_receiver][month] <= cumulatedReceptionLimit[_receiver];
  }
}
